import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card';
import Sdata from './Sdata';
import Netflix from './Netflix';
console.log(Sdata[0]);
// import Project1 from './Project1'
// import Project2 from './Project2'
// root
function ncard(val){
    return(
<Card key={val.id} imgsrc={val.imgsrc} text={val.text} title={val.title} link={val.link}/>
    );
}
ReactDOM.render(<>
<h1>List Off 5 Netflix Series</h1>
{Sdata.map(ncard)}
</>
,document.getElementById('root'));


// if else condition
const series="netflix"
const FavS=()=>{
if (series==="netflix") {
        return <Netflix />
}
else{
        return(
<Card key={Sdata[2].id} 
imgsrc={Sdata[2].imgsrc} 
text={Sdata[2].text}
 title={Sdata[2].title}
  link={Sdata[2].link}/>
    ); 
}
}
ReactDOM.render(<>
<h1>List Of Series</h1>
<Netflix/>
</>
,document.getElementById('root1'));

//end root
